import { useEffect, useState } from 'react';
import { addEmpToDB } from '../Service/service';
import './testB.css';

export default function TestB() {
    return (
        <>
        <div className='testBdiv'>
            <h3>Click the Button to get the data from the backend</h3>
            <form id='empform'>
                <div class="mb-3">
                    <label for="namebox" class="form-label">Full Name</label>
                    <input type="text" class="form-control" id="namebox"/>
                </div>
            </form>

            <button className="btn btn-primary" onClick={addEmpToDB}>Add Employee</button>
        </div>
        </>
    );
}
